import React from 'react';


function Dashboard() {
    return (
        <div className = "dashboard-container">
            <h1>Dashboard</h1>
            <div>
                <a href="https://normaly0.github.io/" target="_blank" >
                <iframe src="https://normaly0.github.io/" />
                </a>
            </div>
        </div>
    )
}

export default Dashboard;
